import { useEffect, useState } from 'react';
import './Dashboard.css';
import { Link, Outlet,useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();
  const [usercount,setusercount]=useState(0);
  const [shopcount,setshopcount]=useState(0);
  useEffect(() => {
    const checkSession = async () => {
        const response = await fetch('http://localhost:5000/admin/checksession', {
            credentials: 'include'
        });

        if (response.ok) {
            const data = await response.json();
            setusercount(data.details.users.length);
            setshopcount(data.details.shops.length);            
        } else {
            navigate('/login');
            
        }
    };

    checkSession();
}, [navigate]);
  return (
    <div className="dashboard3">
      <header className="upperbar">
        <Link to={'/admindashboard'}><h1>Boxplay Admin Panel</h1></Link>
        <h1 className='dashboard4'>DashBoard</h1>
        <span className="logout" onClick={() => alert("Logged out")}>
          Logout
        </span>
      </header>
      <nav className="navbar1">
        <ul>
            <Link to='ManageUsers'><li>Manage Users</li></Link>
            <Link to='VerifyUsers'><li>Verify Users</li></Link>
            <Link to='ManageShops'><li>Manage Shops</li></Link>
        </ul>
      </nav>
      <main className="content">
        <Outlet></Outlet>
        <h1>Total Users Count:{usercount}</h1>
        <h1>Total Users Count:{shopcount}</h1>
      </main>
    </div>
  );
}

export default Dashboard;
